  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'Integração'
};
export const metadata = {
  "unversionedId": "integrations",
  "id": "integrations",
  "isDocsHomePage": false,
  "title": "Integração",
  "description": "Com o SDK da R2U integrado ao site, terá acesso ao Visualizador 3D,  Customizador 3D e a Experiência RA. Nossas aplicações podem ser visualizadas na nossa Live Demo.",
  "source": "@site/docs/integrations.md",
  "slug": "/integrations",
  "permalink": "/docs/integrations",
  "version": "current",
  "sidebar": "docs",
  "next": {
    "title": "Inicialização",
    "permalink": "/docs/"
  }
};
  /* @jsxRuntime classic */
/* @jsx mdx */

export const toc = [{
  value: 'Integração via JavaScript tag',
  id: 'integração-via-javascript-tag',
  children: []
}, {
  value: 'Integração via JavaScript Package manager',
  id: 'integração-via-javascript-package-manager',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Com o SDK da R2U integrado ao site, terá acesso ao `}<inlineCode parentName="p">{`Visualizador 3D`}</inlineCode>{`, `}<inlineCode parentName="p">{` Customizador 3D`}</inlineCode>{` e a `}<inlineCode parentName="p">{`Experiência RA`}</inlineCode>{`. Nossas aplicações podem ser visualizadas na nossa `}<strong parentName="p"><a parentName="strong" {...{
          "href": "https://r2u-io.github.io/documentation/"
        }}>{`Live Demo`}</a></strong>{`.
A integração do SDK de Realidade Aumentada da R2U pode ser feita de duas maneiras equivalentes:`}</p>
    <h2 {...{
      "id": "integração-via-javascript-tag"
    }}>{`Integração via JavaScript tag`}</h2>
    <p>{`Para utilizar o SDK, adicione a tag no header do HTML do website. Isso pode ser feito através de um sistema gerenciador de tags como o Google Tag Manager ou através da plataforma do seu e-commerce.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`  <html lang=pt-br>
    <head>
      <title>Como fazer a integração do SDK da R2U</title>
      <script src=https://unpkg.com/@r2u/javascript-ar-sdk@5.3.1/dist/index.js></script>
    </head>

      <body> /*Seu código HTML*/ </body>
  </html>
`}</code></pre>
    <p>{`Um exemplo de implementação pode ser visto na nossa `}<strong parentName="p"><a parentName="strong" {...{
          "href": "https://r2u-io.github.io/documentation/"
        }}>{`Live Demo`}</a></strong>{`, que usa o código da pasta `}<strong parentName="p"><a parentName="strong" {...{
          "href": "https://github.com/r2u-io/documentation/tree/master/docs"
        }}>{`Docs`}</a></strong>{`.`}</p>
    <h2 {...{
      "id": "integração-via-javascript-package-manager"
    }}>{`Integração via JavaScript Package manager`}</h2>
    <p>{`Adicione o SDK através de npm ou yarn no seu projeto JavaScript.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`  # usando npm
  npm install @r2u/javascript-ar-sdk

  # usando yarn
  yarn add @r2u/javascript-ar-sdk">
`}</code></pre>
    <p>{`Depois importe o sdk no seu projeto e desestruture o objeto R2U de dentro da window`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`  import '@r2u/javascript-ar-sdk'
  const { R2U } = window
`}</code></pre>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
